import React, { Component } from "react";
import {BrowserRouter, Route, Switch} from "react-router-dom";
import Customers from "./components/Customers"
import './App.css';



class App extends Component {

    render(){
        return(
            <BrowserRouter>
                <Switch>
                    <Route path="/customers">
                        <Customers />
                    </Route>
                </Switch>
            </BrowserRouter>
        );
    }

}

export default App;
